const FPS_24 = (1 / 24) * 1000;
const ROT_SPEED = 5 / 180;
const cube = parcel.getFeatureById("rot-cube");
function rotateTick() {
    cube.rotation.y += ROT_SPEED;
    setTimeout(() => {
        requestAnimationFrame(rotateTick);
    }, FPS_24);
}
rotateTick(1);
console.log("ROTATING SETUP");
let animation1 = feature.createAnimation('rotation')

animation1.setKeys([{
  frame: 30, // standard is 30 fps (means it take 1 second)
  value: feature.position.add( new Vector3(0, (feature.rotation.y + Math.PI / 2), 0) )
}])

feature.startAnimations( [animation1] ) //Starts the animation
